from typing import Optional,List

from fastapi import FastAPI
from pydantic import BaseModel
class Team1(BaseModel):
    No_less_than : int
    No_more_than : int
class corr(BaseModel):
    game: int
    Team: int
    player: str
    min_lineups: int
    flags : List[int]
    team_constraint: Team1
    opp_team_constraint: Team1
class Legacy(BaseModel):
    position: str
    player: str
    position_flag: int
    player_flag: int
    type1: str
    num_of_players: int
    #size_position :int
    #size_player : int
    player_positions : List[str]
    players_list: List[str]
    same_team: int
    different_team: int
class People(BaseModel):
    playerId: Optional[int]=0
    salary: Optional[int]=0
    name: str
    team: Optional[str]=None
    position: Optional[str]=None
    slate_playerId: Optional[str]=None
    ownership: Optional[float] =0
    proj_pts_aggressive: Optional[float]=0.0
    proj_pts_conservative: Optional[float]=0.0
    proj_pts: Optional[float]=0.0
    bang_for_your_buck_conservative: Optional[float]=0.0
    bang_for_your_buck_aggressive: Optional[float]=0.0
    isChecked: Optional[bool]=True
    isLocked: Optional[bool]=False
    min_exp: Optional[int]=0
    max_exp: Optional[int]=100
class opp(BaseModel):
    home_team : str
    away_team : str
class perteam(BaseModel):
    type1: str
    num_of_players: int
    team: str
class comb(BaseModel):
    items: int
    mini1: int
    maxi1: int
    #size_players1 :int
    player1: List[str]
    mini2: Optional[int]=0
    maxi2: Optional[int]=0
    #size_players2:Optional[int]=0
    player2: Optional[List[str]] =[]
    num_line_ups: int
class stacki(BaseModel):
    correlation: int
    legacy: int
    per_team: int
    player_combination: int
class corri(BaseModel):
    universal :int
    values : List[corr]
class opti(BaseModel):
    sal_range: List[int]
    fp_range: List[int]
    sal_cap: List[int]
    ownership_cap : List[int]
    lineups: int
    flag_disallow: bool
    forcing_flex: bool
    optimisation: str
    uniqueness: int
class total(BaseModel):
    #players_size:int
    total_player: List[People]
    stacking: stacki
    correlation: corri
    #legacy_size:int
    legacy: List[Legacy]
    #opposite_team_size:int
    opposite_team : List[opp]
    #per_team_size : int
    perTeam : List[perteam]
    #Player_combination_size : int
    combination: List[comb]
    #excluded_players_size:int
    excludedPlayer: List[People]
    optimizer_panel : opti
    #locked_players_size:int
    locked_player :List[People]
